script:
reset();

const origin = {
  x: -16,
  y: 0,
  z: -16,
};
const size = {
  x: 32,
  y: 12,
  z: 32,
};
const floors = 3;

box(
  origin.x - 1, origin.y, origin.z - 1,
  size.x + 2, size.y + 1, 2,
  4
);
box(
  origin.x + size.x - 2,
  origin.y,
  origin.z - 1,
  floors * 7 + 6 + 2, floors * 8 + 3, size.z + 2,
  4
);

[
  { origin, size, lx: -2, lz: -2 },
  {
    origin: { x: origin.x + size.x * 0.25, y: origin.y, z: origin.z + size.z - 1 },
    size: { x: size.x * 0.5, y: size.y, z: size.z * 0.5 },
    lx: -2,
    lz: 0,
  },
].forEach(({ origin, size, lx, lz }) => {
  box(
    origin.x - 1, origin.y, origin.z + 1,
    size.x + 2, size.y + 1, size.z,
    4
  );
  // Room
  box(
    origin.x, origin.y, origin.z,
    size.x, size.y, size.z,
    1
  );
  box(
    origin.x + 1, origin.y + 1, origin.z + 1,
    size.x - 2, size.y - 2, size.z - 2,
    0
  );
  // Lights
  box(
    origin.x + 1, origin.y + size.y - 2, origin.z + 1,
    size.x - 2, 1, size.z - 2,
    (x, y, z) => (
      Math.abs(z + lz) % 5 === 0 ? (
       Math.abs(x + lx) % 5 === 0 ? 0 : 2
      ) : (
       Math.abs(x + lx) % 5 === 0 ? 2 : 0
      )
    )
  );
});

// Controls
for (let i = 0; i < 3; i += 1) {
  box(
    origin.x - i,
    origin.y + 1,
    origin.z + size.z * 0.5 - 5,
    1, 8, 10,
    i === 0 ? 0 : (i === 1 ? 1 : 4)
  );
}

// Door
box(
  origin.x + size.x * 0.5 - 3,
  origin.y + 1,
  origin.z + size.z - 2,
  6, 6, 3,
  1
);
box(
  origin.x + size.x * 0.5 - 2,
  origin.y + 1,
  origin.z + size.z - 2,
  4, 5, 3,
  0
);
if (false) {
  box(
    origin.x + size.x * 0.5 - 1,
    origin.y + 1,
    origin.z + size.z - 1,
    2, 5, 1,
    5
  );
}

// Skin Edtior
box(
  origin.x + size.x * 0.5 - 1,
  origin.y + 1,
  origin.z + size.z * 1.5 - 7,
  2, 2, 2,
  1
);

// Elevators room
box(
  origin.x + size.x - 1,
  origin.y,
  origin.z,
  floors * 7 + 6, floors * 8 + 2, size.z,
  1
);
box(
  origin.x + size.x,
  origin.y + 1,
  origin.z + 1,
  floors * 7 + 6 - 2, floors * 8, size.z - 2,
  0
);

box(
  origin.x + size.x,
  origin.y + 1,
  origin.z + 1,
  1, floors * 8 - 1, 1,
  3
);
box(
  origin.x + size.x,
  origin.y + 1,
  origin.z + size.z - 2,
  1, floors * 8 - 1, 1,
  3
);
box(
  origin.x + size.x,
  origin.y + floors * 8,
  origin.z + 1,
  1, 1, size.z - 2,
  1
);
box(
  origin.x + size.x,
  origin.y + size.y - 4,
  origin.z + 1,
  1, 1, size.z - 2,
  1
);

for (let i = 0; i < floors; i += 1) {
  const x = origin.x + size.x + 4 + i * 7;
  const y = origin.y + i * 8;
  box(
    x,
    y,
    origin.z + 1,
    8, 8, size.z - 2,
    1
  );
  box(
    x,
    y + 1,
    origin.z + 1,
    7, 8, size.z - 2,
    0
  );
  box(
    x + 6,
    y,
    origin.z + 1,
    1, 8, 1,
    1
  );
  box(
    x + 6,
    y,
    origin.z + 2,
    1, 8, 1,
    3
  );
  box(
    x + 6,
    y,
    origin.z + size.z - 2,
    1, 8, 1,
    1
  );
  box(
    x + 6,
    y,
    origin.z + 2,
    1, 8, 1,
    3
  );
  box(
    x + 6,
    y,
    origin.z + size.z * 0.5 - 1,
    1, 8, 2,
    3
  );
  box(
    x + 6,
    y,
    origin.z + size.z - 3,
    1, 8, 1,
    3
  );
  box(
    x + 6,
    y + 8,
    origin.z + 1,
    1, 1, size.z - 2,
    1
  );
  for (let j = 0; j < 4; j += 1) {
     const z = (
       origin.z + size.z * 0.5 - 11 + j * 6 + (j > 1 ? 2 : 0)
     );
     box(
      x + 6,
      y + 1,
      z - 1,
      1, 5, 4,
      1
    );
    box(
      x + 6,
      y + 1,
      z,
      2, 4, 2,
      0
    );
    box(
      x + 8,
      y,
      z - 2,
      6, 7, 6,
      4
    );
    box(
      x + 8,
      y + 1,
      z - 1,
      5, 5, 4,
      0
    );
    for (let k = 0; k < 2; k += 1) {
      update(
        x + 9,
        y + 6,
        z - 1 + k * 3,
        5
      );
    }
    box(
      x + 7,
      y + 6,
      z - 1,
      1, 1, 4,
      0
    );
  }
}

// Opening
box(
  origin.x + size.x - 1,
  origin.y + 1,
  origin.z + 3,
  1, size.y - 6, size.z - 6,
  0
);
box(
  origin.x + size.x - 1,
  origin.y + size.y - 5,
  origin.z + 4,
  1, 1, size.z - 8,
  (x, y, z) => (z - 2) % 5 === 0 ? 1 : 2
);
